import React from 'react'
import './Nav.css'
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

function Header1() {
    return (
        <>
           <Container>
                <Navbar bg="light" expand="lg">
                    <Container fluid>
                        <Navbar.Brand href="#">TRAVEL</Navbar.Brand>
                        <Navbar.Toggle aria-controls="navbarScroll" />
                        <Navbar.Collapse id="navbarScroll">
                            <Nav
                                className="me-auto  ms-4 my-2 my-lg-0"
                                style={{ maxHeight: '100px' }}
                                // navbarScroll
                            >
                                <Nav.Link href="/home" className='nav_item'>Home</Nav.Link>
                                <Nav.Link href="#" className='nav_item'>About us</Nav.Link>
                                <Nav.Link href="/profile" className='nav_item'>Profile</Nav.Link>
                            </Nav>
    
                            {/* <Button variant="outline-success">Search</Button> */}
    
                        </Navbar.Collapse>
                    </Container>
                </Navbar>
           </Container>
        </>
    )
}

export default Header1
